import { Tabs } from 'antd';

const { TabPane } = Tabs;

const AccountTabs = () => {
  return(
    <Tabs defaultActiveKey="1">
      <TabPane tab="Мои билеты" key="1">
        Content of Tab Pane 1
      </TabPane>
      <TabPane tab="История заказов" key="2">
        Content of Tab Pane 2
      </TabPane>
    </Tabs>
  )
}

export default AccountTabs;
